// - Added option to turn off the Country Status box.
// - Fixed super soldier calculator. It will remember the last settings.
// - Fixed rank calculator. It will remember the last settings.
// - Fixed influence calculator. It will remember the last settings.
// - Fixed health prediction. Only houses can affect it.
// ===============================================================================
// v4.0.9
// - Banner place recognition.
// ===============================================================================

